import React from  'react';
import ReactDOM from 'react-dom';
import Card from './Card';

ReactDOM.render(
    <>
    <Card sname="Stranger's Things" pic="https://upload.wikimedia.org/wikipedia/en/f/f7/Stranger_Things_season_2.jpg"></Card>
    <Card sname="Dark"></Card>
    <Card sname="HellBound"></Card>
    <Card sname="The Haunting of hill House"></Card>
    </>,
    document.getElementById("root")
)
